description:
The Celestine Prophecy is a 1993 novel by James Redfield which discusses various psychological and spiritual ideas which are often regarded as New Age themes. The main character of the novel undertakes a journey to find and understand a series of nine spiritual insights on an ancient manuscript in Peru. The book is a first-person narrative of the narrator&amp;#039;s spiritual awakening as he goes through a transitional period of his life.

As of May 2005, it had sold over 20 million copies worldwide [1] and had been translated into 34 languages. A movie of the same title, based on the book, was released in 2006. Redfield has published two sequels: The Tenth Insight: Holding the Vision and The Secret of Shambhala: In Search of the Eleventh Insight, he is currently working on a fourth book to cover the twelfth insight.



